  \"\",\n\t\t\"description\": \"A map service on the www depicting the locations of
  activities within the Stewardship Contracting Project Boundary. Activities are implemented
  through stewardship contracts or agreements and are self-reported by Forest Service
  Units through the FACTS database. Stewardship End Result Contracting helps achieve
  land management goals while meeting local and rural community needs, including contributing
  to the sustainability of rural communities and providing a continuing source of
  local income and employment. It focuses on the \"end result\" ecosystem benefits
  and outcomes, rather than on what's removed from the land. The USDA Forest Service
  and the Interior Department's Bureau of Land Management (BLM) received authority
  to implement stewardship contracting and agreements in Section 347 Omnibus Consolidated
  Appropriations Act of FY 1999, as amended by Sec. 323 of P.L. 108-7, 2003. As spatial
  data is a new requirement for the program, we hope to improve the quality and comprehensiveness
  of this data in coming years. \",\n\t\t\"format\": \"HTML\",\n\t\t\"tracking_summary\":
